package problem859

import "testing"

func TestBuddyStrings(t *testing.T) {
	testCases := []struct {
		s    string
		goal string
		want bool
	}{
		{
			s:    "abcaa",
			goal: "abcbb",
			want: false,
		},
		{
			s:    "ab",
			goal: "ba",
			want: true,
		},
		{
			s:    "ab",
			goal: "ab",
			want: false,
		},
		{
			s:    "aa",
			goal: "aa",
			want: true,
		},
		{
			s:    "",
			goal: "",
			want: true,
		},
	}

	for _, tC := range testCases {
		if got := buddyStrings(tC.s, tC.goal); got != tC.want {
			t.Errorf("Test failed. The input s = \"%s\", goal = \"%s\" is expected to %t but return %t", tC.s, tC.goal, tC.want, got)
		}
	}
}
